import React from 'react';
import { Link } from '@reach/router';

const Login = (props) => {
	return (
		<section id="logged_in">
			<p>user: {props.user}</p>
			{props.user === 'default' && (
				<Link to="/login" id="login_link">
					Login
				</Link>
			)}
		</section>
	);
};

export default Login;
